function createGrid() {
  const cells = [];
  for (let w = 4; w < 41; w++) {
    cells.push(<div id={w} className="cells" key={w}></div>);
  }
  return cells;
}
const Home = () => {
  return (
    <div id="home">
      <div id="grid-container">{createGrid()}</div>
    </div>
  );
};

export default Home;
